import React, { Component } from 'react';
import App from './App';

class Signup extends Component {
    render() { 
        return (
            <React.Fragment>
                <App />
                <div>
                    This is a login Page
                </div>
            </React.Fragment>
        );
    }
}
 
export default Signup;
